import "./styles.css";
import data from "./demo-data.json";
import React, { useState } from "react";

export default function App() {
  const [input, setInput] = useState('')
console.log(input)

  const Wrapper = ({ path, property, children }: { path?: (string | number)[], property: string, children: React.ReactNode }) => {
    return <div className="indented">
      <span className={path ? "clickable-property key" : "key"}
      onClick={() => path ? setInput(path.join('.')) : {}}
      >{`${property}: `}</span>;
      {children}
    </div>
  }

  const iterateObject = (object: any, path = ['res']) => {
    return Object.keys(object).map((key) => {
      let objectPath = [...path, key]

      switch (typeof object[key]) {
        case "string":
        return (
            <Wrapper key={key} path={objectPath} property={key}>
              {`"${object[key]}"`}
            </Wrapper>)
        case "boolean":
          return (
            <Wrapper key={key} path={objectPath} property={key}>
              {object[key].toString()}
            </Wrapper>)
        default:
          if (Array.isArray(object[key])) {
            return (
              <Wrapper key={key} property={key}>
                [
                {object[key].map((elem: any, index: number) => <>&#123;{iterateObject(elem, [...objectPath, index])}&#125;</>)}
                ]
              </Wrapper>
            )
          } else {
            return (
              <Wrapper key={key} property={key}>
                &#123;
                {iterateObject(object[key], objectPath)}
                &#125;
              </Wrapper>
            )

          }
      }
    });
  };

  return (
    <div className="App">
      <div>
        <label htmlFor="property-input">Property</label>
        <input type="text" id="property-input" />
      </div>

      <div>
        Response
        <div>{iterateObject(data)}</div>
      </div>
    </div>
  );
}
